import React from 'react'
import Target from '../Components/blog/Target'
import datos from '../data/datos.json';

function Projects() {
    return (
        <div>
            <h1>Proyectos</h1>
            <h3>Backend</h3>
            {
                // Aqui se va a crear cada una de las targetas para cada proyecto
                datos.backend.map((app) => (
                    <button key={app.id}>
                        <Target id={app.id} image={app.image} title={app.title} description={app.description} ></Target>
                        <div className="">
                            <div className="imagen">
                                <img src={app.image} alt={app.title} />
                            </div>
                            <div className="description">
                                <h2>{app.title}</h2>
                                {app.description}
                            </div>
                        </div>
                    </button>
                ))
            }
        </div>
    )
}

export default Projects
